David and Brenda are perfect for each other, and everyone knows it except David and Brenda. After they break up, due to mutual immaturity, they voyage through a romantic Purgatory that shakes both of them to their core, until they realize what's apparent, and work out a design for being together that they refuse to call &quot;being together&quot;. A sharply observed, dark comedy about the complexity of modern relationships, In Stereo is a humorous look into the lives of confused 30 somethings trying to figure it all out. 

